INSERT INTO `wp_wc_admin_notes` VALUES (3,'wc-admin-wc-helper-connection','info','en_US','Connect to WooCommerce.com','Connect to get important product notifications and updates.','info','{}','unactioned','woocommerce-admin','2020-05-19 17:07:47',NULL,0,'',NULL,0),(4,'wc-update-db-reminder','update','en_US','Yêu cầu cập nhật cơ sở dữ liệu Quản lý bán hàng','Quản lý bán hàng đã được cập nhật! Để đảm bảo mọi thứ hoạt động trơn tru, chúng tôi cần cập nhật cơ sở dữ liệu lên bản mới nhất. Quá trình cập nhật cơ sở dữ liệu sẽ chạy nền và sẽ mất chút thời gian, hãy kiên nhẫn. Người dùng cao cấp có thể cập nhật thay thế qua <a href=\"https://github.com/woocommerce/woocommerce/wiki/Upgrading-the-database-using-WP-CLI\">WP CLI</a>.','info','{}','unactioned','woocommerce-core','2020-05-03 16:11:33',NULL,0,'plain',NULL,0),(6,'wc-admin-mobile-app','info','en_US','Install Woo mobile app','Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics — wherever you are.','phone','{}','unactioned','woocommerce-admin','2020-05-23 08:54:54',NULL,0,'',NULL,0),(7,'wc-admin-facebook-extension','info','en_US','Market on Facebook','Grow your business by targeting the right people and driving sales with Facebook. You can install this free extension now.','thumbs-up','{}','unactioned','woocommerce-admin','2020-05-23 08:54:54',NULL,0,'',NULL,0),(8,'wc-admin-onboarding-email-marketing','info','en_US','Tips, product updates, and inspiration','Chúng tôi ở đây cùng bạn — nhận các mẹo, thông tin, và cảm hứng trực tiếp đến email của bạn.','mail','{}','unactioned','woocommerce-admin','2020-05-23 08:54:54',NULL,0,'',NULL,0),(9,'wc-admin-usage-tracking-opt-in','info','en_US','Help WooCommerce improve with usage tracking','Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the <a href=\"http://myhome.muathemewordpress.net/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Settings</a> and choose to stop sharing data. <a href=\"https://woocommerce.com/usage-tracking\" target=\"_blank\">Read more</a> about what data we collect.','info','{}','unactioned','woocommerce-admin','2020-05-31 13:43:49',NULL,0,'',NULL,0),(10,'wc-admin-marketing-intro','info','en_US','Connect with your audience','Grow your customer base and increase your sales with marketing tools built for WooCommerce.','speaker','{}','unactioned','woocommerce-admin','2020-06-18 17:19:06',NULL,0,'',NULL,0),(11,'wc-admin-store-notice-giving-feedback-2','info','en_US','Give feedback','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.','info','{}','unactioned','woocommerce-admin','2020-07-21 03:11:59',NULL,0,'plain','',0),(13,'wc-admin-real-time-order-alerts','info','en_US','Get real-time order alerts anywhere','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.','info','{}','unactioned','woocommerce-admin','2021-01-15 20:00:21',NULL,0,'plain','',0),(14,'ecomm-need-help-setting-up-your-store','info','en_US','Need help setting up your Store?','Schedule a free 30-min <a href=\"https://wordpress.com/support/concierge-support/\">quick start session</a> and get help from our specialists. We’re happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.','info','{}','pending','woocommerce.com','2021-01-08 20:32:05',NULL,0,'plain','',0),(15,'woocommerce-services','info','en_US','WooCommerce Shipping & Tax','WooCommerce Shipping &amp; Tax helps get your store \"ready to sell\" as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.','info','{}','pending','woocommerce.com','2021-01-08 20:32:05',NULL,0,'plain','',0),(16,'ecomm-unique-shopping-experience','info','en_US','For a shopping experience as unique as your customers','Product Add-Ons allow your customers to personalize products while they\'re shopping on your online store. No more follow-up email requests—customers get what they want, before they\'re done checking out. Learn more about this extension that comes included in your plan.','info','{}','pending','woocommerce.com','2021-01-08 20:32:05',NULL,0,'plain','',0),(17,'wcpay-promo-2020-11','marketing','en_US','wcpay-promo-2020-11','wcpay-promo-2020-11','info','{}','pending','woocommerce.com','2021-01-10 21:32:05',NULL,0,'plain','',0),(18,'wcpay-subscriptions-2020-11','marketing','en_US','Manage subscriber payments from your store\'s dashboard','Securely accept cards and manage transactions right from your dashboard with <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Payments</a>  – now supporting <a href=\"https://woocommerce.com/products/woocommerce-subscriptions/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Subscriptions</a>! <br /><br /><em>By clicking \"Install now,\" you agree to our <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">Terms of Service</a>.</em>','info','{}','pending','woocommerce.com','2021-01-14 09:32:05',NULL,0,'plain','',0),(19,'wcpay-promo-2020-12','marketing','en_US','wcpay-promo-2020-12','wcpay-promo-2020-12','info','{}','pending','woocommerce.com','2021-01-10 21:32:05',NULL,0,'plain','',0),(20,'wcpay-subscriptions-2020-12','marketing','en_US','Manage payments from your store\'s dashboard','Securely accept cards and manage transactions right from your dashboard with <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">WooCommerce Payments</a>! Zero setup fees or monthly fees. Just pay-as-you-go, starting at just 2.9% + $0.30 per transaction for U.S.-issued cards. <br /><br /><em>By clicking \"Install now,\" you agree to our <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay_ctrl20\" target=\"_blank\">Terms of Service</a>.</em>','info','{}','pending','woocommerce.com','2021-01-14 09:32:05',NULL,0,'plain','',0),(21,'wc-admin-onboarding-payments-reminder','info','en_US','Start accepting payments on your store!','Take payments with the provider that’s right for you - choose from 100+ payment gateways for Quản lý bán hàng.','info','{}','unactioned','woocommerce-admin','2021-01-18 07:21:26',NULL,0,'plain','',0),(22,'wc-admin-insight-first-sale','survey','en_US','Did you know?','A Quản lý bán hàng powered store needs on average 31 days to get the first sale. You\'re on the right track! Do you find this type of insight useful?','info','{}','unactioned','woocommerce-admin','2021-01-18 07:21:26',NULL,0,'plain','',0),(23,'wc-admin-manage-orders-on-the-go','info','en_US','Manage your orders on the go','Look for orders, customer info, and process refunds in one click with the Woo app.','info','{}','unactioned','woocommerce-admin','2021-01-18 07:21:26',NULL,0,'plain','',0),(24,'your-first-product','info','en_US','Your first product','That’s huge! You’re well on your way to building a successful online store — now it’s time to think about how you’ll fulfill your orders.<br /><br />Read our shipping guide to learn best practices and options for putting together your shipping strategy. And for WooCommerce stores in the United States, you can print discounted shipping labels via USPS with <a href=\"https://href.li/?https://woocommerce.com/shipping\" target=\"_blank\">WooCommerce Shipping</a>.','info','{}','pending','woocommerce.com','2021-01-19 08:56:52',NULL,0,'plain','',0),(25,'wc-admin-home-screen-feedback','info','en_US','Help us improve the Quản lý bán hàng Home screen','We\'d love your input to shape the future of the Quản lý bán hàng Home screen together. Feel free to share any feedback, ideas or suggestions that you have.','info','{}','unactioned','woocommerce-admin','2021-02-06 03:57:20',NULL,0,'plain','',0),(26,'wc-admin-getting-started-in-ecommerce','info','en_US','Getting Started in eCommerce - webinar','We want to make eCommerce and this process of getting started as easy as possible for you. Watch this webinar to get tips on how to have our store up and running in a breeze.','info','{}','pending','woocommerce.com','2021-01-31 14:57:20',NULL,0,'plain','',0),(27,'wc-admin-performance-on-mobile','info','en_US','Track your store performance on mobile','Monitor your sales and high performing products with the Woo app.','info','{}','unactioned','woocommerce-admin','2021-02-26 12:35:42',NULL,0,'plain','',0),(28,'facebook_pixel_api_2021','marketing','en_US','Improve the performance of your Facebook ads','Enable Facebook Pixel and Conversions API through the latest version of Facebook for WooCommerce for improved measurement and ad targeting capabilities.','info','{}','pending','woocommerce.com','2021-02-22 10:35:43',NULL,0,'plain','',0),(29,'facebook_ec_2021','marketing','en_US','Sync your product catalog with Facebook to help boost sales','A single click adds all products to your Facebook Business Page shop. Product changes are automatically synced, with the flexibility to control which products are listed.','info','{}','pending','woocommerce.com','2021-02-22 10:35:43',NULL,0,'plain','',0),(30,'wc-square-apple-pay-boost-sales','marketing','en_US','Boost sales with Apple Pay','Now that you accept Apple Pay® with Square you can increase conversion rates by letting your customers know that Apple Pay® is available. Here’s a marketing guide to help you get started.','info','{}','pending','woocommerce.com','2021-02-22 10:35:43',NULL,0,'plain','',0),(31,'wc-square-apple-pay-grow-your-business','marketing','en_US','Grow your business with Square and Apple Pay ','Now more than ever, shoppers want a fast, simple, and secure online checkout experience. Increase conversion rates by letting your customers know that you now accept Apple Pay®.','info','{}','pending','woocommerce.com','2021-02-22 10:35:43',NULL,0,'plain','',0),(32,'wc-admin-optimizing-the-checkout-flow','info','en_US','Optimizing the checkout flow','It’s crucial to get your store’s checkout as smooth as possible to avoid losing sales. Let’s take a look at how you can optimize the checkout experience for your shoppers.','info','{}','pending','woocommerce.com','2021-02-21 06:35:43',NULL,0,'plain','',0),(33,'wc-admin-first-five-things-to-customize','info','en_US','The first 5 things to customize in your store','Deciding what to start with first is tricky. To help you properly prioritize, we’ve put together this short list of the first few things you should customize in WooCommerce.','info','{}','pending','woocommerce.com','2021-02-21 06:35:43',NULL,0,'plain','',0),(34,'wc-admin-effortless-payments-by-mollie','info','en_US','Effortless payments by Mollie','Offer global and local payment methods, get onboarded in minutes and supported in your language – try it now!','info','{}','pending','woocommerce.com','2021-02-26 05:35:43',NULL,0,'plain','',0),(35,'wcpay-apple-pay-boost-sales','marketing','en_US','Boost sales with Apple Pay','Now that you accept Apple Pay® with WooCommerce Payments you can increase conversion rates by letting your customers know that Apple Pay® is available. Here’s a marketing guide to help you get started.','info','{}','pending','woocommerce.com','2021-03-18 04:23:46',NULL,0,'plain','',0),(36,'wcpay-apple-pay-grow-your-business','marketing','en_US','Grow your business with WooCommerce Payments and Apple Pay','Now more than ever, shoppers want a fast, simple, and secure online checkout experience. Increase conversion rates by letting your customers know that you now accept Apple Pay®.','info','{}','pending','woocommerce.com','2021-03-18 04:23:46',NULL,0,'plain','',0),(37,'paypal_ppcp_gtm_2021','marketing','en_US','Offer more options with the new PayPal','Get the latest PayPal extension for a full suite of payment methods with extensive currency and country coverage.','info','{}','pending','woocommerce.com','2021-04-25 12:49:12',NULL,0,'plain','',0),(38,'wcpay-apple-pay-is-now-available','marketing','en_US','Apple Pay is now available with WooCommerce Payments!','Increase your conversion rate by offering a fast and secure checkout with <a href=\"https://woocommerce.com/apple-pay/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_applepay\" target=\"_blank\">Apple Pay</a>®. It’s free to get started with <a href=\"https://woocommerce.com/payments/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_applepay\" target=\"_blank\">WooCommerce Payments</a>.','info','{}','pending','woocommerce.com','2021-04-25 12:49:12',NULL,0,'plain','',0),(39,'wc-payments-qualitative-feedback','info','en_US','WooCommerce Payments setup - let us know what you think','Congrats on enabling WooCommerce Payments for your store. Please share your feedback in this 2 minute survey to help us improve the setup process.','info','{}','pending','woocommerce.com','2021-04-24 08:49:13',NULL,0,'plain','',0),(40,'share-your-feedback-on-paypal','info','en_US','Share your feedback on PayPal','Share your feedback in this 2 minute survey about how we can make the process of accepting payments more useful for your store.','info','{}','pending','woocommerce.com','2021-05-12 04:03:38',NULL,0,'plain','',0),(41,'wcpay_instant_deposits_gtm_2021','marketing','en_US','Get paid within minutes – Instant Deposits for WooCommerce Payments','Stay flexible with immediate access to your funds when you need them – including nights, weekends, and holidays. With <a href=\"https://woocommerce.com/products/woocommerce-payments/?utm_source=inbox&amp;utm_medium=product&amp;utm_campaign=wcpay_instant_deposits\">WooCommerce Payments\'</a> new Instant Deposits feature, you’re able to transfer your earnings to a debit card within minutes.','info','{}','pending','woocommerce.com','2021-05-13 08:03:38',NULL,0,'plain','',0),(42,'wc-admin-edit-products-on-the-move','info','en_US','Edit products on the move','Edit and create new products from your mobile devices with the Woo app','info','{}','unactioned','woocommerce-admin','2021-06-07 10:40:54',NULL,0,'plain','',0),(43,'google_listings_and_ads_install','marketing','en_US','Drive traffic and sales with Google','Reach online shoppers to drive traffic and sales for your store by showcasing products across Google, for free or with ads.','info','{}','pending','woocommerce.com','2021-06-03 22:40:54',NULL,0,'plain','',0),(44,'wc-subscriptions-security-update-3-0-15','info','en_US','WooCommerce Subscriptions security update!','We recently released an important security update to WooCommerce Subscriptions. To ensure your site’s data is protected, please upgrade <strong>WooCommerce Subscriptions to version 3.0.15</strong> or later.<br /><br />Click the button below to view and update to the latest Subscriptions version, or log in to <a href=\"https://woocommerce.com/my-dashboard\">WooCommerce.com Dashboard</a> and navigate to your <strong>Downloads</strong> page.<br /><br />We recommend always using the latest version of WooCommerce Subscriptions, and other software running on your site, to ensure maximum security.<br /><br />If you have any questions we are here to help — just <a href=\"https://woocommerce.com/my-account/create-a-ticket/\">open a ticket</a>.','info','{}','pending','woocommerce.com','2021-06-03 22:40:54',NULL,0,'plain','',0),(45,'wayflyer_q3_2021','marketing','en_US','Grow your revenue with Wayflyer financing and analytics','Flexible financing tailored to your needs by <a href=\"https://woocommerce.com/products/wayflyer/\">Wayflyer</a> – one fee, no interest rates, penalties, equity, or personal guarantees. Based on your store\'s performance, Wayflyer can provide the financing you need to grow and the analytical insights to help you spend it.','info','{}','pending','woocommerce.com','2021-07-18 16:13:54',NULL,0,'plain','',0),(46,'eu_vat_changes_2021','marketing','en_US','Get your business ready for the new EU tax regulations','On July 1, 2021, new taxation rules will come into play when the <a href=\"https://ec.europa.eu/taxation_customs/business/vat/modernising-vat-cross-border-ecommerce_en\">European Union (EU) Value-Added Tax (VAT) eCommerce package</a> takes effect.<br /><br />The new regulations will impact virtually every B2C business involved in cross-border eCommerce trade with the EU.<br /><br />We therefore recommend <a href=\"https://woocommerce.com/posts/new-eu-vat-regulations\">familiarizing yourself with the new updates</a>, and consult with a tax professional to ensure your business is following regulations and best practice.','info','{}','pending','woocommerce.com','2021-07-18 16:13:54',NULL,0,'plain','',0),(47,'woocommerce-core-update-5-4-0','info','en_US','Update to WooCommerce 5.4.1 now','WooCommerce 5.4.1 addresses a checkout issue discovered in WooCommerce 5.4. We recommend upgrading to WooCommerce 5.4.1 as soon as possible.','info','{}','pending','woocommerce.com','2021-07-17 12:13:54',NULL,0,'plain','',0),(48,'wcpay-promo-2021-6-incentive-1','marketing','en_US','Simplify the payments process for you and your customers with WooCommerce Payments','With <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay601\">WooCommerce Payments</a>, you can securely accept all major cards, Apple Pay®, and recurring revenue in over 100 currencies.\n				Built into your store’s WooCommerce dashboard, track cash flow and manage all of your transactions in one place – with no setup costs or monthly fees.\n				<br /><br />\n				By clicking \"Get WooCommerce Payments,\" you agree to the <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay601\">Terms of Service</a>\n				and acknowledge you have read the <a href=\"https://automattic.com/privacy/\">Privacy Policy</a>.\n				','info','{}','pending','woocommerce.com','2021-07-18 16:13:54',NULL,0,'plain','',0),(49,'wcpay-promo-2021-6-incentive-2','marketing','en_US','Simplify the payments process for you and your customers with WooCommerce Payments','With <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay601\">WooCommerce Payments</a>, you can securely accept all major cards, Apple Pay®, and recurring revenue in over 100 currencies.\n				Built into your store’s WooCommerce dashboard, track cash flow and manage all of your transactions in one place – with no setup costs or monthly fees.\n				<br /><br />\n				By clicking \"Get WooCommerce Payments,\" you agree to the <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay601\">Terms of Service</a>\n				and acknowledge you have read the <a href=\"https://automattic.com/privacy/\">Privacy Policy</a>.\n				','info','{}','pending','woocommerce.com','2021-07-18 16:13:54',NULL,0,'plain','',0),(50,'ppxo-pps-upgrade-paypal-payments-1','info','en_US','Get the latest PayPal extension for WooCommerce','Heads up! There’s a new PayPal on the block!<br /><br />Now is a great time to upgrade to our latest <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">PayPal extension</a> to continue to receive support and updates with PayPal.<br /><br />Get access to a full suite of PayPal payment methods, extensive currency and country coverage, and pay later options with the all-new PayPal extension for WooCommerce.','info','{}','pending','woocommerce.com','2021-07-17 12:13:54',NULL,0,'plain','',0),(51,'ppxo-pps-upgrade-paypal-payments-2','info','en_US','Upgrade your PayPal experience!','Get access to a full suite of PayPal payment methods, extensive currency and country coverage, offer subscription and recurring payments, and the new PayPal pay later options.<br /><br />Start using our <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">latest PayPal today</a> to continue to receive support and updates.','info','{}','pending','woocommerce.com','2021-07-17 12:13:54',NULL,0,'plain','',0),(52,'woocommerce-core-sqli-july-2021-need-to-update','update','en_US','Action required: Critical vulnerabilities in WooCommerce','In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.','info','{}','pending','woocommerce.com','2021-07-17 12:13:54',NULL,0,'plain','',0),(53,'woocommerce-blocks-sqli-july-2021-need-to-update','update','en_US','Action required: Critical vulnerabilities in WooCommerce Blocks','In response to a critical vulnerability identified on July 13, 2021, we are working with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br />Our investigation into this vulnerability is ongoing, but <strong>we wanted to let you know now about the importance of updating immediately</strong>.<br /><br />For more information on which actions you should take, as well as answers to FAQs, please urgently review our blog post detailing this issue.','info','{}','pending','woocommerce.com','2021-07-17 12:13:54',NULL,0,'plain','',0),(54,'woocommerce-core-sqli-july-2021-store-patched','update','en_US','Solved: Critical vulnerabilities patched in WooCommerce','In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.','info','{}','pending','woocommerce.com','2021-07-17 12:13:54',NULL,0,'plain','',0),(55,'woocommerce-blocks-sqli-july-2021-store-patched','update','en_US','Solved: Critical vulnerabilities patched in WooCommerce Blocks','In response to a critical vulnerability identified on July 13, 2021, we worked with the WordPress Plugins Team to deploy software updates to stores running WooCommerce (versions 3.3 to 5.5) and the WooCommerce Blocks feature plugin (versions 2.5 to 5.5).<br /><br /><strong>Your store has been updated to the latest secure version(s)</strong>. For more information and answers to FAQs, please review our blog post detailing this issue.','info','{}','pending','woocommerce.com','2021-07-17 12:13:54',NULL,0,'plain','',0),(56,'bbpos-chipper-launch','marketing','en_US','Ready to grow your business beyond online?','Collect payment in person for orders placed online using WooCommerce In-Person Payments. The BBPOS Chipper card reader can process payments securely, and keep everything synced in your WooCommerce Payments dashboard – no matter where you are.','info','{}','pending','woocommerce.com','2021-10-17 00:05:19',NULL,0,'plain','',0),(57,'new_in_app_marketplace_2021','info','en_US','Customize your store with extensions','Check out our NEW Extensions tab to see our favorite extensions for customizing your store, and discover the most popular extensions in the WooCommerce Marketplace.','info','{}','pending','woocommerce.com','2022-03-10 11:55:31',NULL,0,'plain','',0),(58,'wayflyer_bnpl_q4_2021','marketing','en_US','Grow your business with funding through Wayflyer','Fast, flexible financing to boost cash flow and help your business grow – one fee, no interest rates, penalties, equity, or personal guarantees. Based on your store’s performance, Wayflyer provides funding and analytical insights to invest in your business.','info','{}','pending','woocommerce.com','2022-03-10 11:55:31',NULL,0,'plain','',0),(59,'wc_shipping_mobile_app_usps_q4_2021','marketing','en_US','Print and manage your shipping labels with WooCommerce Shipping and the WooCommerce Mobile App','Save time by printing, purchasing, refunding, and tracking shipping labels generated by <a href=\"https://woocommerce.com/woocommerce-shipping/\">WooCommerce Shipping</a> – all directly from your mobile device!','info','{}','pending','woocommerce.com','2022-03-10 11:55:31',NULL,0,'plain','',0),(60,'wc_shipping_mobile_app_q4_2021','marketing','en_US','Print and manage your shipping labels with the WooCommerce Mobile App','Save time by printing, purchasing, refunding, and tracking shipping labels generated by <a href=\"https://woocommerce.com/woocommerce-shipping/\">WooCommerce Shipping</a> – all directly from your mobile device!','info','{}','pending','woocommerce.com','2022-03-10 11:55:31',NULL,0,'plain','',0),(61,'habit-moment-survey','marketing','en_US','We’re all ears! Share your experience so far with WooCommerce','We’d love your input to shape the future of WooCommerce together. Feel free to share any feedback, ideas or suggestions that you have.','info','{}','pending','woocommerce.com','2022-03-10 11:55:31',NULL,0,'plain','',0),(62,'ecomm-wc-navigation-survey','info','en_US','We’d like your feedback on the WooCommerce navigation','We’re making improvements to the WooCommerce navigation and would love your feedback. Share your experience in this 2 minute survey.','info','{}','pending','woocommerce.com','2022-03-10 11:55:31',NULL,0,'plain','',0),(63,'wcpay_applepay_q1_2022','marketing','en_US','Increase conversions with Apple Pay – just like Diane does','See how Diane from <a href=\"https://woocommerce.com/posts/lady-dye-yarns-from-crafts-to-activism-with-woocommerce/?utm_source=product&amp;utm_medium=inboxnotification&amp;utm_campaign=apple-pay\" target=\"_blank\">Lady Dye Yarns</a> uses Apple Pay to provide customers with the fast, secure checkout experience they love. You can, too – Apple Pay is included in WooCommerce Payments. Here\'s how you can increase conversions by encouraging shoppers to pay with a single tap.','info','{}','pending','woocommerce.com','2022-03-11 01:55:31',NULL,0,'plain','',0),(64,'stripe_applepay_q1_2022','marketing','en_US','Increase conversions with Apple Pay – just like Thomas does','Read the inspirational story of <a href=\"https://woocommerce.com/posts/incredible-story-of-thomas-trendy-socks-down-syndrome-entrepreneur/?utm_source=product&amp;utm_medium=inboxnotification&amp;utm_campaign=apple-pay\" target=\"_blank\">Thomas\'s Trendy Socks</a> and see how he’s using Apple Pay to provide customers with the fast, secure checkout experience they love. You can, too – ready to turn more visitors into buyers? Accept Apple Pay by selecting Enable express checkouts in Settings &gt; Payments &gt; Stripe.','info','{}','pending','woocommerce.com','2022-03-11 01:55:31',NULL,0,'plain','',0),(65,'square_applepay_q1_2022','marketing','en_US','Increase conversions with a faster checkout experience','By enabling Apple Pay in Square, your customers can complete purchases quickly and securely with a single touch or a glance – no lengthy checkout forms necessary. Accept Apple Pay by enabling Digital Wallets within Settings &gt; Payments &gt; Square.','info','{}','pending','woocommerce.com','2022-03-11 01:55:31',NULL,0,'plain','',0),(66,'woocommerce-core-paypal-march-2022-updated','update','en_US','Security auto-update of WooCommerce','<strong>Your store has been updated to the latest secure version of WooCommerce</strong>. We worked with WordPress to deploy PayPal Standard security updates for stores running WooCommerce (version 3.5 to 6.3). It’s recommended to disable PayPal Standard, and use <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">PayPal Payments</a> to accept PayPal.','info','{}','unactioned','woocommerce.com','2022-03-10 11:55:31',NULL,0,'plain','',0),(67,'woocommerce-core-paypal-march-2022-updated-nopp','update','en_US','Security auto-update of WooCommerce','<strong>Your store has been updated to the latest secure version of WooCommerce</strong>. We worked with WordPress to deploy security updates related to PayPal Standard payment gateway for stores running WooCommerce (version 3.5 to 6.3).','info','{}','pending','woocommerce.com','2022-03-10 11:55:31',NULL,0,'plain','',0),(68,'pinterest_03_2022_update','marketing','en_US','Your Pinterest for WooCommerce plugin is out of date!','Update to the latest version of Pinterest for WooCommerce to continue using this plugin and keep your store connected with Pinterest. To update, visit <strong>Plugins &gt; Installed Plugins</strong>, and click on “update now” under Pinterest for WooCommerce.','info','{}','pending','woocommerce.com','2022-03-27 00:35:31',NULL,0,'plain','',0),(69,'lead_gen_existing_customers_1','marketing','en_US','Talk to a consultant','As your business grows, you want to optimize costs, streamline operations, and sell more. We can help. Talk to us about how you can get the most out of WooCommerce.','info','{}','pending','woocommerce.com','2022-04-20 13:31:17',NULL,0,'plain','',0),(70,'setup_task_initiative_survey_q2_2022','survey','en_US','We want to know what matters most to you','Take 2 minutes to give us your input on what is important for you while setting up your store and help shape the future of WooCommerce together.','info','{}','pending','woocommerce.com','2022-05-21 14:20:06',NULL,0,'plain','',0),(71,'affirm_q2_2022','marketing','en_US','Boost your business with flexible payments','Expand your customer base with smarter payment options for more shoppers. With Affirm,  you can offer the most relevant payment options at every price point – from four interest-free payments every two weeks to longer installments up to 36 months. Fast-track your revenue goals today!','info','{}','pending','woocommerce.com','2022-05-21 14:20:06',NULL,0,'plain','',0),(72,'setup_task_second_survey_q2_2022','survey','en_US','We want to know what matters most to you','Take 2 minutes to give us your input on what is important for you while setting up your store and help shape the future of WooCommerce together.','info','{}','pending','woocommerce.com','2022-05-21 14:20:06',NULL,0,'plain','',0),(73,'store_setup_survey_survey_q2_2022','survey','en_US','How is your store setup going?','Our goal is to make sure you have all the right tools to start setting up your store in the smoothest way possible.\r\nWe’d love to know if we hit our mark and how we can improve. To collect your thoughts, we made a 2-minute survey.','info','{}','pending','woocommerce.com','2022-05-21 14:20:06',NULL,0,'plain','',0),(74,'wc-admin-EU-consumer-protection','marketing','en_US','Important changes to EU consumer protection laws','New regulations to help modernize and strengthen consumer protection laws in the European Union (EU) take effect on May 28, 2022. These rules impact all merchants selling to the EU, regardless of where their business is located. Further detailed information is available on the European Commission\'s official website.','info','{}','unactioned','woocommerce.com','2022-05-21 14:20:06',NULL,0,'plain','',0),(75,'googlelistings_multicountrygtm_q22022','marketing','en_US','Expand your audience with Multi-Country Advertising','It\'s time to expand your audience with Multi-Country Advertising, an exciting new feature in Google Listings &amp; Ads. Reach more potential customers in as many regions as you like within a single campaign, all from the convenience of your WooCommerce dashboard.','info','{}','unactioned','woocommerce.com','2022-05-21 14:20:06',NULL,0,'plain','',0);
